me': u'Catalina Olivares Estay', u'id': u'10203552077577617'}, u'id': u'379322602098011_971007'}, {u'message': u'hermosas palabras hermosos corazones', u'from': {u'name': u'Ronald Zepeda Jara', u'id': u'10205361754987523'}, u'id': u'379322602098011_971564'}, {u'message': u'Discutían, no mentían y ponían garra, corazón y coraje en solucionar el problema, el que fuese. Pero siempre, todas las noches, nos despedían hasta mañana con un beso y dormían juntos', u'from': {u'name': u'Patricia Hortel', u'id': u'10207271054791148'}, u'id': u'379322602098011_972325'}, {u'message': u'los tiempos han cambiado y la gente tambien. lamentablemente.', u'from': {u'name': u'Betty Franco Burton', u'id': u'10207280388186958'}, u'id': u'379322602098011_972838'}, {u'message': u'Todo se arregla cuando hay verdadero amor! Amor como el de Dios!', u'from': {u'name': u'Amparo Serna Gonzalez', u'id': u'10152640344738173'}, u'id': u'379322602098011_972926'}, {u'message': u'Toda la razón Betty Franco Burton, por lo mismo un pequeño recordatorio de que todavía podemos tener fé siempre es bueno. Saludos :)', u'from': {u'category': u'Non-Governmental Organization (NGO)', u'name': u'Psic\xf3logos Voluntarios de Chile', u'category_list': [{u'id': u'2235', u'name': u'Non-Governmental Organization (NGO)'}], u'id': u'124568870906720'}, u'id': u'379322602098011_973744'}, {u'message': u'Las cosas son desechables...las personas no...', u'from': {u'name': u'Marcela Bellemans Valenzuela', u'id': u'10205961569017245'}, u'id': u'379322602098011_974926'}, {u'message': u'tu también Noithier... así te verás...', u'from': {u'name': u'Shirley Marjorie Hurtado Riffo', u'id': u'10207381860163081'}, u'id': u'379322602098011_975299'}, {u'message': u'Muy cierto!', u'from': {u'name': u'Jana Cohn', u'id': u'10152670790625009'}, u'id': u'379322602098011_977268'}, {u'message': u'concreta en una idea, la realidad de una relacion duradera.....es hermoso. gracias Vita. tqm', u'from': {u'name': u'Angie Achury', u'id': u'10205994231602269'}, u'id': u'379322602098011_980193'}, {u'message': u'<3', u'from': {u'name': u'Valentina Mu\xf1oz Guzm\xe1n', u'id': u'10205111519016729'}, u'id': u'379322602098011_982003'}, {u'message': u':D', u'from': {u'name': u'Scarlet Vergara', u'id': u'10203412225721118'}, u'id': u'379322602098011_984570'}, {u'message': u'Aplaudo esa respuesta, muy sabia! <3', u'from': {u'name': u'Pedro Antonio Lizama', u'id': u'10207480417830707'}, u'id': u'379322602098011_995313'}, {u'message': u'como cambian los tiempos', u'from': {u'name': u'Alicia Santana', u'id': u'10206754270753911'}, u'id': u'379322602098011_1002837'}, {u'message': u'Sí, es cierto... por eso estos recordatorios son buenos... hay cosas que no debemos olvidar :) Un abrazo', u'from': {u'category': u'Non-Governmental Organization (NGO)', u'name': u'Psic\xf3logos Voluntarios de Chile', u'category_list': [{u'id': u'2235', u'name': u'Non-Governmental Organization (NGO)'}], u'id': u'124568870906720'}, u'id': u'379322602098011_1002844'}, {u'message': u'antes los matrimonios (cuando se casaban por amor y no eran arreglados), eran mas como un equipo, se apoyaban, se perdonaban, pensaban en el otro..... ahora es una lucha de egoismos, solo se preocupan de que el otro satisfaga las necesidades personales, y si no lo hace, esta todo mal, por ende debe desecharse. Una tristeza....', u'from': {u'name': u'Alicia Santana', u'id': u'10206754270753911'}, u'id': u'379322602098011_1002848'}, {u'message': u'PERO ALICIA...IGUAL TIENES QUE RECORDAR...que antes se vivia en una sociedad mas machista que ahora...donde la mujer aguantaba todo...cuando el marido tenia amantes,la mujer calladita no mas acataba "porque el marido se cansaba por el trabajo y tenia que distraerse"...antes la mujer no podia ser "amante" de su esposo...era mal visto...y cuando el marido le pegaba...calladita no mas se que.daba...era normal...por eso duraban los matrimonios...ahora tenemos voz y voto...y no aguantamos maltratos...', u'from': {u'name': u'Filomena Isabel', u'id': u'10205030083772780'}, u'id': u'379322602098011_1002855'}, {u'message': u'aunque todavia siguen muriendo mujeres por el maltrato', u'from': {u'name': u'Filomena Isabel', u'id': u'10205030083772780'}, u'id': u'379322602098011_1002856'}, {u'message': u'No un me encAnta? =)! jejeje', u'from': {u'name': u'Marilia L\xf3pez', u'id': u'10205320675949506'}, u'id': u'379322602098011_1003937'}, {u'message': u'Que tierno nati cuando hay amor hay todo besitos para todos prima.', u'from': {u'name': u'Stella Maris Carrasco', u'id': u'10206743626569326'}, u'id': u'379322602098011_1013825'}, {u'message': u'EL AMOR DE MIS PADRES FUE ASI......', u'from': {u'name': u'Jaime Andres Segovia Reyes', u'id': u'10208926915952843'}, u'id': u'379322602098011_1021329'}], u'summary': {u'total_count': 36, u'order': u'chronological'}}

